  input: "\"TEXT\",\"F3XA\",\"C00143743\",\"July 9, 2007    Mr. Daniel T. Buckley
    \ Federal Election Commission  Washington, D. C., 20463    Re:\tFebruary Monthly
    Report (Jan 1 - Jan 31, 2007)    Dear Mr. Buckley:    Pursuant to your letter
    dated June 8, 2007, we are filing this amended report.  The Republican Party requests
    on each original solicitation in a clear and conspicuous manner the employer and
    occupation of the donor being solicited.  Letters are mailed to each donor who
    does not provide the information on the original response device requesting the
    missing information within thirty days of receipt.  The letter provides a response
    device and return envelope for the donor.   We have updated the employer and occupation
    information on several donors reported on this report and will submit future amendments
    for any additional donor occupation and employer information that may be received.
    \     Schedule H4, payment to Lilly & Company, is for administrative travel expenses
    of vendor and is not for fundraising purposes.  Schedule D for debts to vendors
    has changed as a result of amended prior year reports.  Reimbursement to Jeff
    Fisher in the amount of $85.80 has been corrected to itemize each vendor on Schedule
    H4.  Additional expense on Schedule B line 30 reflects additional payments in
    the amount of $74.35 for payroll taxes, including SUTA and FUTA expenses.  The
    Levin account has been corrected to reflect the accurate activity for the period
    and ending balance.    Respectfully submitted,  Wayne Tucker\""
